Jankowce (, "Yankivtsi") is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Lesko"&gt;Gmina Lesko&lt;/a&gt;, within &lt;a href="Lesko%20County"&gt;Lesko County&lt;/a&gt;, &lt;a href="Subcarpathian%20Voivodeship"&gt;Subcarpathian Voivodeship&lt;/a&gt;, in south-eastern Poland. It lies approximately north-east of &lt;a href="Lesko"&gt;Lesko&lt;/a&gt; and south of the regional capital &lt;a href="Rzesz%C3%B3w"&gt;Rzeszów&lt;/a&gt;.
